package model;

public class LamBaiKiemTra {
	private long MaKH;
	private long MaCH;
	private long UserID;
	private String DapAn;
	
	
	
	public LamBaiKiemTra() {
		super();
		// TODO Auto-generated constructor stub
	}
	public long getMaKH() {
		return MaKH;
	}
	public void setMaKH(long maKH) {
		MaKH = maKH;
	}
	public long getMaCH() {
		return MaCH;
	}
	public void setMaCH(long maCH) {
		MaCH = maCH;
	}
	public long getUserID() {
		return UserID;
	}
	public void setUserID(long userID) {
		UserID = userID;
	}
	public String getDapAn() {
		return DapAn;
	}
	public void setDapAn(String dapAn) {
		DapAn = dapAn;
	}
	
	
}
